import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { environment } from '../pages/environments/environment';
import { Factura } from '../pages/domain/factura';

@Injectable({
  providedIn: 'root'
})
export class FacturaService {

  constructor(private http: HttpClient) { }

  getFacturas(){
    let url = environment.WS_PATH + "/facturas/list/"
    return this.http.get<any>(url)
  }

  saveFacturas(factura: Factura, cedula){
    let url = environment.WS_PATH + "/facturas/"
    return this.http.post<any>(url, factura)
  }
  getCliente(cedula: String){
    let url = environment.WS_PATH+"/facturas?dni="+cedula
    console.log(url)
    return this.http.get(url)
  }
}
